import Header from "../Header/Header";
import MobileNavBar from "../MobileNavBar/MobileNavBar";
import './ContactPage.css';
import { useEffect } from "react";
import Reviews from "../Reviews/Reviews";

export default function ContactPage({ terms, onCatClick, category, onBurgerClick, onBurgerClose, isBurgerOpen, search, setSearch, orders, cart }) {
  useEffect(() => {
    document.title = 'Контакты - Долина самоцветов';
  }, []);
  
  return (
    <>
      <main className="reviews">
        <h1 className="">Отзывы</h1>
        <div className="reviews-container">
          
        </div>
      </main>
      <MobileNavBar
      onBurger={onBurgerClick} 
      isBurgerOpen={isBurgerOpen} 
      onBurgerClose={onBurgerClose}
      cart={cart}
      onCatClick={onCatClick}
      orders={orders}
      />
    </>
  )
}
